import './Header.css'
import {Picture} from 'react';
import CardHeader from '@material-ui/core/CardHeader';


export default class Headers extends Component {
    render() {
        return (
            <div className="Header">
                <ul>
                    <li><a></a></li>
                    <li><a href="#news"></a></li>
                    <li><a href="#contact"></a></li>
                    <li><a href="#about"></a></li>
                </ul>
            </div>
        )
    }
}
